import React from "react";
import twitter from './images/grey-twitter-icon.png'
import facebook from './images/grey-facebook-icon.png'
import instagram from './images/grey-instagram-icon.png'
import github from './images/grey-github-icon.png'

export default function Footer() {
    return (
        <footer>
            <img src={twitter} className="social-icon"></img>
            <img src={facebook} className="social-icon"></img>
            <img src={instagram}></img>
            <img src={github}></img>
        </footer>
    );
}
